import React, { Component } from 'react';
import { CardArea, Title, DescTitle, Rate, Desc } from './style';

export const Card = () => {
  return (
    <CardArea>
      <Title>
        {this.props.size}
      </Title>
      <Rate>
        5000
      </Rate>
      <DescTitle>
        Accommodates
      </DescTitle>
      <Desc>
        3 people
      </Desc>
    </CardArea>
  );
};
